INSERT INTO `lemon_assessment_questions` VALUES (1,1,'I am a long range thinker - I think in decades and even centuries',1,0),(2,2,'I am a long term thinker - I think in years and decades rather than months',3,0),(3,3,'I am able to plan and organize things efficiently and effectively',3,0),(4,4,'I am action orientated',4,0),(5,5,'I am aware of relational capital',5,0),(6,6,'I am deliberate in my actions',3,0),(7,7,'I am good at identifying issues',4,0),(8,8,'I am known as an encourager',5,0),(9,9,'I seldom get offended or take things personally',3,0),(10,10,'I find it difficult to administer discipline',5,0),(11,11,'I am protective of opportunities',2,0),(12,12,'I am viewed as steady/stable',3,0),(13,13,'I am willing to do anything it takes to get something moving',2,0),(14,14,'I believe that ideas precede activities',1,0),(15,15,'I believe that opportunities (more than ideas) lead to activities',2,0),(16,16,'I build conceptual frameworks',1,0),(17,17,'I can \'read\' people',5,0),(18,18,'I can articulate ideas clearly',1,0),(19,19,'I can easily see the long term implications of today\'s thinking',1,0),(20,20,'I can exhaust those around me with too many ideas',1,0),(21,21,'I can make things happen \'out of nothing\'',2,0),(22,22,'I can move quickly from one opportunity to the next',2,0),(23,23,'I can stay focused on a dream for a LONG time',1,0),(24,24,'I care a lot about \'Why\' and less about \'How, When, How much\'',1,0),(25,25,'I care more about connecting people - the \'Who\'',5,0),(26,26,'I deflect responsibility for practical tasks',5,0),(27,27,'I do not fail, I just have lots of \'learning experiences\'',2,0),(28,28,'I do not relish conflict in a relationship',5,0),(29,29,'I do the tasks that get a quick result',4,0),(30,30,'I easily pick the things that must be done',4,0),(31,31,'I find out people\'s stories',5,0),(32,32,'I generally sense what people want',5,0),(33,33,'I have a very high risk tolerance',2,0),(34,34,'I have an intuitive sense of the needs of others',4,0),(35,35,'I have an intuitive sense of the viability of opportunities',2,0),(36,36,'I have lots of new ideas',1,0),(37,37,'I instinctively build networks',5,0),(38,38,'I intuitively understand what is out in the future',1,0),(39,39,'I know what is really happening in the organization',4,0),(40,40,'I like to be complimented for efficiency',3,0),(41,41,'I like to be complimented for my ideas',1,0),(42,42,'I like to be complimented for my loyal performance',4,0),(43,43,'I love to bring people together',5,0),(44,44,'I love to bring things to a close',4,0),(45,45,'I make others feel at ease in my presence',5,0),(46,46,'I often see opportunities that others do not see',2,0),(47,47,'I protect my ideas',1,0),(48,48,'I quickly get to what needs to be done',4,0),(49,49,'I readily do practical tasks',4,0),(50,50,'I remember people',5,0),(51,51,'I take pride in being able to get things accomplished',3,0),(52,52,'I think more about the next quarter or year than the next decade',2,0),(53,53,'I think that proper planning precedes activities',3,0),(54,54,'I translate ideas into opportunities',2,0),(55,55,'I understand things like processes, procedures, policies and planning',3,0),(56,56,'I value concepts, ideas, and fresh thinking',1,0),(57,57,'I value those who spot opportunities and take action to make them happen',2,0),(58,58,'I view failure as lack of planning',3,0),(59,59,'I work wherever there is work to do',4,0),(60,60,'I would rather build a team to get something done than just do it myself',3,0),(61,61,'I would rather do things myself than delegate them',4,0),(62,62,'If given a bad situation, I am able to shape it to make it viable',3,0),(63,63,'My energy and enthusiasm draw people to me',2,0),(64,64,'My ideas are inspiring to others',1,0),(65,65,'My motto is: Get on board or get out of the way',2,0),(66,66,'My motto is: I have thought it all through.',1,0),(67,67,'My motto is: Let\'s stop talking about it and do it!',4,0),(68,68,'My motto is: If it is not broken do not touch it!',3,0),(69,69,'My motto is: Let\'s get together',5,0),(70,70,'My performance is characterized by consistency',3,0),(71,71,'My work is completing tasks',4,0),(72,72,'My work is connecting people',5,0),(73,73,'My work is establishing infrastructure',3,0),(74,74,'My work is launching new things',2,0),(75,75,'Others do not realize how much I do',4,0);
