INSERT INTO `strategy` VALUES (7,'I stuffed that one up a bit. test\nAdd a modification. See how it goes.',1,1,1,1,1,'2014-02-20 00:26:19'),(8,'Integrate all we do consistent with our Values and Foundational Principles so that we live out our Vision.',NULL,2,1,1,NULL,'2012-12-10 04:41:16'),(9,'Explore the right governance structure for the various organizations in our household so that accountability is effective, growth is not impeded, and integrity is beyond question.',NULL,3,1,1,NULL,'2012-12-10 04:41:16'),(10,'Create an atmosphere and environment where we constantly seek and invite God\'s presence so his purposes in each life we touch can be accomplished. ',NULL,4,1,1,NULL,'2012-12-10 04:41:16'),(11,'India: Clarifying and documenting the Institute\'s values, then propagating them to the community through discipleship so that the Institute remains true to their purpose and foundational values even as they expand. ',NULL,5,1,1,NULL,'2012-12-10 04:41:16'),(12,'Focus on trunk health by \"bedding-down\" our core products and preparing them for multiplication and expansion.<br />\n',NULL,1,1,2,NULL,'2012-12-10 04:41:16'),(13,'Increase communication and understanding with new and past clients so they can  engage across and within product streams.<br />\n',NULL,2,1,2,NULL,'2012-12-10 04:41:16'),(14,'Improve existing book distribution to increase impact and income.  ',NULL,3,1,2,NULL,'2012-12-10 04:41:16'),(15,'Conduct \"Repurposing Business Training\" twice a year so that more people have an opportunity to explore foundational truths pertaining to their work as ministry and to walk it out in a practical way in the context of community.',NULL,4,1,2,NULL,'2012-12-10 04:41:16'),(16,'Develop and improve the online scorecard so that we can utilize it as a useful tool to ensure we implement our strategies to the fullest, and provide it to others to help with their implementation.',NULL,5,1,2,NULL,'2012-12-10 04:41:17'),(17,'India: Reassess existing Institute products and their applicability in the Indian market so that we are seen as innovative, competitive and appealing.',NULL,6,1,2,NULL,'2012-12-10 04:41:18'),(18,'India: Investigate and create new Institute products such as HR specific product line that can complement the existing product architecture so that we have a greater depth of offerings to meet customer needs. ',NULL,7,1,2,NULL,'2012-12-10 04:41:18'),(19,'Host Intensive to impact international Executives and Leaders in week long training so that their businesses are repurposed and their societies impacted through the content and on-going relationship with the rep community.  ',NULL,8,1,2,NULL,'2012-12-10 04:41:18'),(20,'Create additional online Assessments for Transforming Society so that we can fill the gaps in our Product Architecture and offer a more comprehensive, effective service to clients. KW - this \"so that\" is inwardly focused. What do we want to help our clients achieve?',NULL,9,1,2,NULL,'2012-12-10 04:41:18'),(21,'must have been cancelled or something',NULL,1,1,3,1,'2013-01-25 00:09:16'),(22,'Execute a Positioning Campaign with Alumni and Stakeholders to ensure that they are effective Brand Ambassadors.',3,2,1,3,1,'2013-01-25 19:55:16'),(23,'Improve and streamline our web presence to increase web-generated leads and sales for our products.',NULL,1,1,4,NULL,'2012-12-10 04:41:18'),(24,'Improve our use of social networking to continue to build and connect our worldwide community.',NULL,2,1,4,NULL,'2012-12-10 04:41:18'),(25,'Improve existing product distribution to increase impact and income. <br />\n',NULL,3,1,4,NULL,'2012-12-10 04:41:18'),(26,'Identify and equip \"complementors\" in each location who can build awareness of us, and create demand for our products. ',NULL,4,1,4,NULL,'2012-12-10 04:41:18'),(27,'Develop a more intentional strategy about progressing and converting leads at in-person events and other community building funnels so that we have a broader reach overall. ',NULL,5,1,4,NULL,'2012-12-10 04:41:19'),(28,' To streamline and optimize our process of preparing for recruiting events so that we can leverage them more efficiently as a marketing tool and provide consistent and excellent service.',NULL,6,1,4,NULL,'2012-12-10 04:41:19'),(29,'India: Develop a process by which to approach Client Recruitment so that we expand our presence in a measurable and methodical manner.',NULL,7,1,4,NULL,'2012-12-10 04:41:19'),(30,'India: Create a database of potential corporate and education businesses and organizations so that the Institute can build relationship and presence in those sectors.',NULL,8,1,4,NULL,'2012-12-10 04:41:19'),(31,'Create a testimonial capture page that will allow the community to enter client/consultant testimonies and to view a database of existing ones so that people will be encouraged and strengthened in their faith.',NULL,9,1,4,NULL,'2012-12-10 04:41:19'),(32,'Expand our current partnering relationships to include additional HOPs that will further the purpose of Transforming Society. add something.\nAnd yet something more',1,1,1,5,1,'2013-02-23 21:09:36'),(33,'Develop a core competence in Partnering for HOT and selected alumni so that we can capitalize on the large number of looming partnering opportunities.',NULL,2,1,5,NULL,'2012-12-10 04:41:19'),(34,'Encourage US-based rep business owners to transform their spheres of influence and build community.',NULL,3,1,5,NULL,'2012-12-10 04:41:20'),(35,'India: Identify, assess and initiate partnerships that are mutually beneficial, aligned with the Institute\'s purpose and result in greater impact and presence in the marketplace. ',NULL,4,1,5,NULL,'2012-12-10 04:41:20'),(36,'Ensure that we have the right staff and renumeration in place to handle the core functions needed to support the level of field activity (US and abroad). ',NULL,1,1,7,NULL,'2012-12-10 04:41:20'),(37,'Develop an on-going list of intern projects for those who would like to volunteer for a set period of time. ',NULL,2,1,7,NULL,'2012-12-10 04:41:20'),(38,'Revisit Leadership Track / Broader Alumni Relations Strategy to better deploy and support our community. <br />\nNote: Is this the right strategy?',NULL,3,1,7,NULL,'2012-12-10 04:41:20'),(39,' Develop a way for committed community to be more connected to us.',NULL,4,1,7,NULL,'2012-12-10 04:41:20'),(40,'India: Involve the existing rep alumni and draw them into both community and ministry together.',NULL,5,1,7,NULL,'2012-12-10 04:41:20'),(41,'Refine and implement accreditation process for our product streams to increase global impact and provide incremental revenue.',NULL,6,1,7,NULL,'2012-12-10 04:41:20'),(42,'Develop post training 10-P and 10-F assessments for trainees so that they have a way of systematically measuring the impact of training on their lives and can clearly communicate the benefits to their friends and family, whilst giving the Institute quantifiable feedback measures to improve future training.',NULL,7,1,7,NULL,'2012-12-10 04:41:20'),(43,'Improve our soft processes to grow our community and release leaders to walk out their callings.',NULL,1,1,6,NULL,'2012-12-10 04:41:20'),(44,'Determine what it means to do e-publishing first, and then complement with hard copy.<br />\n',NULL,2,1,6,NULL,'2012-12-10 04:41:20'),(45,'Focus on trunk-health by bedding-down our core processes and removing pain points to prepare us for multiplication and expansion.  ',NULL,3,1,6,NULL,'2012-12-10 04:41:20'),(46,'Streamline and optimize our process of preparing for webinar/seminars/events so that we can leverage them more efficiently as a marketing tool and provide consistent and excellent service. ',NULL,4,1,6,NULL,'2012-12-10 04:41:21'),(47,'Ensure that every day miscellaneous tasks are completed in timely fashion to ensure the Office runs smoothly and effectively.',NULL,5,1,6,NULL,'2012-12-10 04:41:21'),(48,' Improve our process of keeping in contact with leads (after events) so that we know how and when to approach them for potential training',NULL,6,1,6,NULL,'2012-12-10 04:41:21'),(49,'Expand community building opportunities by identifying additional places to share and teach hospitality.',NULL,1,1,8,NULL,'2012-12-10 04:41:21'),(50,'Develop a framework for Place and future campus so that our needs are clearly articulated.',NULL,2,1,8,NULL,'2012-12-10 04:41:21'),(51,'Develop the \"go to nation\" strategy for new countries.',NULL,3,1,8,NULL,'2012-12-10 04:41:21'),(52,'Issue planning summary communications so that stakeholders can actively align with our strategies and initiatives.',NULL,1,1,9,NULL,'2012-12-10 04:41:21'),(53,'Construct and document a comprehensive and cohesive sales and marketing plan so that resources can be allocated, targets can be met, and The Institute can have greater impact, both wide and deep. ',NULL,2,1,9,NULL,'2012-12-10 04:41:21'),(54,'Develop more intentional Vine Associates fundraising model for community expenses.',NULL,1,1,10,NULL,'2012-12-10 04:41:21'),(55,'Develop and implement our Sales Methodology to convert a greater percentage of leads and contacts into revenue-producing work. ',NULL,2,1,10,NULL,'2012-12-10 04:41:21'),(56,' Re-examine pricing of products to ensure profitability.',NULL,3,1,10,NULL,'2012-12-10 04:41:21'),(57,'India: Develop strong, steady revenue streams so that we ensure sustainability and increase impact.',NULL,4,1,10,NULL,'2012-12-10 04:41:22'),(58,'Maintain and add functionality to the Church Management System (noah) so that Admin Office staff are fully enabled to do their jobs and the church is better served as a result.',NULL,1,2,2,NULL,'2012-12-10 04:41:34'),(59,'Maintain and add functionality to the Church Intranet (ark) so that Admin Office staff are fully enabled to do their jobs and the church is better served as a result. ',NULL,2,2,2,NULL,'2012-12-10 04:41:34'),(60,'Deal with errors and bugs found in Noah so that the system is robust and with fewer errors.',NULL,3,2,2,NULL,'2012-12-10 04:41:35'),(61,'Construct Reporting module for Noah so that we can more efficiently data mine the DB for useful information',NULL,4,2,2,NULL,'2012-12-10 04:41:35'),(62,'Maintain and add functionality to the Stewardship Module of NOAH so that Finance staff are fully enabled to do their jobs in an efficient and productive manner.',NULL,5,2,2,NULL,'2012-12-10 04:41:35'),(63,'Maintain and add functionality to the Groups Module of NOAH so that specific Ministry staff are fully enabled to do their jobs in an efficient and productive manner.',NULL,6,2,2,NULL,'2012-12-10 04:41:35'),(64,'Maintain and add functionality to the Classes Module of NOAH so that all ministries with training classes can begin to use and we can store class information in a single repository.',NULL,7,2,2,NULL,'2012-12-10 04:41:35'),(65,'Inform, educate and encourage ministries to begin using Noah so that we manage the information and begin reporting, tracking and monitoring in an optimal manner.',NULL,1,2,4,NULL,'2012-12-10 04:41:35'),(66,'Maintain a prompt response time and helpful attitude for IT requests so that the relationship between the IT department and office staff is positive.',NULL,1,2,7,NULL,'2012-12-10 04:41:35'),(67,'Keep good relations with third party vendors so that we receive prompt and efficient service. ',NULL,2,2,7,NULL,'2012-12-10 04:41:35'),(68,'Hire a good quality Help Desk administrator so that the services to the ALCF Church Administration staff continue in an efficient and timely manner, with full support coverage.',NULL,3,2,7,NULL,'2012-12-10 04:41:35'),(69,'Create and maintain a stable and operable IT infrastructure framework so that ALCF administrative staff have an environment in which they can remain productive.  ',NULL,1,2,6,NULL,'2012-12-10 04:41:35'),(70,'Institute and maintain a process for backing up key machines and data so that in case of catastrophic disasters we have a process in place to ensure recovery with a minimum loss of time and data ',NULL,2,2,6,NULL,'2012-12-10 04:41:36'),(71,'Maintain Inventory of hardware and software so we can have a baseline around which to develop new hardware rollout strategies',NULL,3,2,6,NULL,'2012-12-10 04:41:36'),(74,'Develop a systematic approach to product development so that we develop useful products that are aligned with our purpose.',NULL,1,3,2,NULL,'2013-01-31 06:41:16'),(75,'Mentoring / discipling of current employees',NULL,1,3,7,NULL,'2013-01-31 06:41:16');
